let testInput = `dabAcCaCBAcCcaDA`;
let input = ``;

function react(data) {
    let prevDataLength = data.length;
    let noMoreMatches = false;
    let finalString = '';

    while(!noMoreMatches) {
        for (let i = 1; i < data.length; i++) {
            let letterOne = data[i - 1];
            let letterTwo = data[(i)];

            let pair = `${letterOne}${letterTwo}`;

            if (letterTwo) {

                if (letterOne.toLowerCase() === letterTwo.toLowerCase()) {
                    if (pair.includes(letterOne.toUpperCase()) && pair.includes(letterOne.toLowerCase())) {
                        data.splice(i - 1, 2);

                        if (data.length === 0) {
                            break;
                        }
                    }
                }
            }
        }

        if (prevDataLength === data.length) {
            noMoreMatches = true;
            finalString = data.join('');
        } else if (data.length < prevDataLength) {
            prevDataLength = data.length;
        }
    }

    return finalString;
}

function partOne(input) {
    let data = input.split('');
    let partOneResult = react(data);
    
    console.log(`Part 1: ${partOneResult.length}`);

    let alphabetArray = 'abcdefghijklmnopqrstuvwxyz'.split('');
    let prevPartTwoStringCount = partOneResult.length;

    for (let i = 0; i < alphabetArray.length; i++) {
        let letter = alphabetArray[i];

        if (partOneResult.indexOf(letter) > -1) {
            let partTwoString = partOneResult.replace(new RegExp(letter, 'g'), '');
            partTwoString = partTwoString.replace(new RegExp(letter.toUpperCase(), 'g'), '');

            let result = react(partTwoString.split(''));

            if (result.length < prevPartTwoStringCount) {
                prevPartTwoStringCount = result.length;
            }
        }
    }

    console.log(`Part 2: ${prevPartTwoStringCount}`);
}

partOne(testInput);
partOne(input);

